import "./faq.css"
import "../images/faq.jpg"
// import QNA from "./QNA"







const Faq = () => {

    return (
        <>
            <div className="faq-heading">Answers to FAQs ;)</div>
            <div className="faq">
                <div><img src={require('../images/faq.jpg')} alt="" /></div>

            </div>

        </>
    )
    // <img src={require('../images/faq.jpg')} alt="" />

}

export default Faq
